,p_process_sequence=>10
,p_process_point=>'ON_DEMAND'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'DEL_DEPT'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'BEGIN',
'  -- Primeiro, desalocar os empregados desse departamento',
'  UPDATE employees',
'  SET department_id = NULL',
'  WHERE department_id = :PXX_SELECTED_DEPARTMENT_ID;',
'',
'  -- Agora, excluir o departamento',
'  DELETE FROM departments',
'  WHERE department_id = :PXX_SELECTED_DEPARTMENT_ID;',
'',
'  COMMIT;',
'EXCEPTION',
'  WHEN OTHERS THEN',
'    ROLLBACK;',
'    APEX_ERROR.ADD_ERROR (',
'      p_message => ''Erro ao excluir o departamento: '' || SQLERRM,',
'      p_display_location => apex_error.c_inline_in_notification',
'    );',
'END;'))
,p_process_clob_language=>'PLSQL'
,p_process_success_message=>'Department Deleted.'
,p_internal_uid=>9495901545605113520
);
end;
